Let’s proceed in a stepwise, careful way:


## Step 1: Key Psychological Mechanisms for Proposer Decisions

As the proposer in the ultimatum game, the participant chooses how much (as % of the pot) to offer to the responder. Their proposal likely depends on:
- **Self-interest:** The more money kept, the higher the immediate reward.
- **Fairness concern:** Proposers may wish to maintain fairness–possibly aiming to split evenly, or to “match” contributions.
- **Contribution-based deservingness:** If one side contributed more to the pot, the proposer may factor this in (weighted, not strict equality).
- **Strategic acceptance:** Proposal should be high enough that the responder is likely to accept (though with noisy or unobservable rule).
- **Randomness/noise:** Human variability not captured by the explicit variables.

Given that the ultimate output is a numerical prediction of the percentage offer (0-100%) as proposer, the model should integrate both self vs. other contribution and fairness.

---

## Step 2: Mechanism Interactions

### How does contribution (token_self, token_opp) impact fairness?

People are sensitive to *relative* contribution, not just absolute, and may anchor on the “proportional split” – offering the responder a share proportional to their contribution (token_opp divided by the combined tokens).

### Should the model directly estimate the expected acceptance probability of the responder?

We don’t have information about the responder’s prior response behavior per se, and with 14 proposer trials, a highly parameterized strategic model would overfit. Also, we do not directly model acceptances in this task.

Instead, it’s reasonable and parsimonious to assume the proposer’s fairness concern reflects both:
- the proportional contribution of both players, and
- a general *generosity/fairness* bias, which may deviate from strict proportionality.

---

## Step 3: Mathematical Form

We seek a model for:  
predicted_proposed_perc = f(own and other contribution, fairness bias, noise)

Let’s consider:

Let
- fair_share = 100 * token_opp / (token_self + token_opp)  -- i.e., proportional contribution
- The *proposer* can be biased toward equal split, proportionality, or selfishness.

Let’s weight the proportional (fair_share) with a learnable parameter that captures the degree to which proposer deviates from proportionality/fairness.

A general, low collinearity model:

predicted_proposed_perc = fairness_weight * fair_share + (1 - fairness_weight) * base_generosity + noise

Where:
- base_generosity is a learnable parameter, capturing minimal generosity independent of tokens (e.g., if participant always offers 20%)
- fairness_weight [0,1]: learnable, how much the proposal tracks proportional share; 1=always proportional, 0=always base rate
- noise: normal Gaussian, to match observed human variability

**Note:** We can collapse base_generosity and fairness_weight into a two-parameter model, with fairness_weight bounded [0,1], base_generosity bounded [0,100].

For identifiability, only a single fairness_weight parameter and base_generosity (no intercept) should be enough; otherwise, the learned fairness_weight can trade off with an intercept, leading to high covariance, violating the prompt’s wishes.

---

## Step 4: Parameter List and Data Mapping

*predicted_proposed_perc*  
= fairness_weight * (100 * token_opp / (token_opp + token_self))  
+ (1 - fairness_weight) * base_generosity  
+ random_normal(0, sigma_noise)

Where:
- base_generosity: lower bound 0, upper bound 100 (bounded at the % endpoints)
- fairness_weight: lower bound 0, upper bound 1
- sigma_noise: lower bound 0.1, upper bound 30 (distribution of response variability, captures human noise)

All variables used are observable or learnable. This is parsimonious, avoids strongly collinear parameterization, and can recover relevant latent variables. The model cleanly predicts the numerical output.

---

## Step 5: Model Output Specification

**Target Variable:** proposed_perc

---

## Final Model Specification

<MODEL>
predicted_proposed_perc = fairness_weight * (100 * token_opp / (token_self + token_opp)) + (1 - fairness_weight) * base_generosity + Normal(0, sigma_noise)
